import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import { Card, CardContent, Typography, LinearProgress } from '@material-ui/core';

const useStyles = makeStyles({
  root: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    flexWrap: 'wrap',
    gap: '16px',
    padding: '16px',
  },
  card: {
    minWidth: '240px',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
  },
  progressContainer: {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '16px',
  },
  progressText: {
    marginLeft: '16px',
  },
  circularProgressContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '16px',
  },
  circularProgress: {
    width: '80px',
    height: '80px',
  },
  circularProgressText: {
    textAlign: 'center',
  },
});

const ViewCourses = () => {
  const classes = useStyles();

  const courses = [
    {
      name: 'Course A',
      progress: 60,
      lastDate: '17/02/2023',
    },
    {
      name: 'Course B',
      progress: 10,
      lastDate: '19/02/2023',
    },
    {
      name: 'Course C',
      progress: 80,
      lastDate: '20/02/2023',
    },
    {
      name: 'Course D',
      progress: 100,
      lastDate: '22/02/2023',
    },
    {
      name: 'Course E',
      progress: 0,
      lastDate: '24/02/2023',
    },
    {
      name: 'Course F',
      progress: 30,
      lastDate: '25/02/2023',
    },
    {
      name: 'Course G',
      progress: 50,
      lastDate: '28/02/2023',
    },
    {
      name: 'Course H',
      progress: 90,
      lastDate: '01/03/2023',
    },
    {
      name: 'Course I',
      progress: 20,
      lastDate: '03/03/2023',
    },
    {
      name: 'Course J',
      progress: 70,
      lastDate: '05/03/2023',
    },
  ];

  const notStarted = courses.filter(course => course.progress === 0).length;
  const inProgress = courses.filter(course => course.progress > 0 && course.progress < 100).length;
  const completed = courses.filter(course => course.progress === 100).length;
  const overdue = courses.filter(course => new Date(course.lastDate) < new Date()).length;

  return (
    <div>
      <div className={classes.circularProgressContainer}>
        <div className={classes.circularProgress}>
          <CircularProgressbar
            value={notStarted}
            maxValue={courses.length}
            text={`${notStarted}/${courses.length}`}
            styles={buildStyles({
              textSize: '16px',
              pathColor: '#F08080',
              textColor: '#F08080',
              trailColor: '#f4f4f4',
            })}
          />
          <div>
          <Typography variant="subtitle1" className={classes.circularProgressText}>
          Not Started
        </Typography>
      </div>
    </div>
    <div className={classes.circularProgress}>
      <CircularProgressbar
        value={inProgress}
        maxValue={courses.length}
        text={`${inProgress}/${courses.length}`}
        styles={buildStyles({
          textSize: '16px',
          pathColor: '#FFD700',
          textColor: '#FFD700',
          trailColor: '#f4f4f4',
        })}
      />
      <div>
        <Typography variant="subtitle1" className={classes.circularProgressText}>
          In Progress
        </Typography>
      </div>
    </div>
    <div className={classes.circularProgress}>
      <CircularProgressbar
        value={completed}
        maxValue={courses.length}
        text={`${completed}/${courses.length}`}
        styles={buildStyles({
          textSize: '16px',
          pathColor: '#90EE90',
          textColor: '#90EE90',
          trailColor: '#f4f4f4',
        })}
      />
      <div>
        <Typography variant="subtitle1" className={classes.circularProgressText}>
          Completed
        </Typography>
      </div>
    </div>
    <div className={classes.circularProgress}>
      <CircularProgressbar
        value={overdue}
        maxValue={courses.length}
        text={`${overdue}/${courses.length}`}
        styles={buildStyles({
          textSize: '16px',
          pathColor: '#DC143C',
          textColor: '#DC143C',
          trailColor: '#f4f4f4',
        })}
      />
      <div>
        <Typography variant="subtitle1" className={classes.circularProgressText}>
          Overdue
        </Typography>
      </div>
    </div>
  </div>
  <div className={classes.root}>
    {courses.map(course => (
      <Card key={course.name} className={classes.card}>
        <CardContent>
          <div className={classes.progressContainer}>
            <LinearProgress variant="determinate" value={course.progress} />
            <Typography variant="subtitle1" className={classes.progressText}>
              {course.progress}%
            </Typography>
          </div>
          <Typography variant="h6" gutterBottom>
            {course.name}
          </Typography>
          <Typography variant="subtitle2" color="textSecondary">
            Last Date: {course.lastDate}
          </Typography>
        </CardContent>
      </Card>
    ))}
  </div>
</div>
);
};

export default ViewCourses;
